INSERT INTO `blogs` (`id`, `title`, `blog_text`, `category_id`, `user_id`, `status`, `blog_thumbnail`, `blog_cover`, `added_date`, `modified_date`) VALUES
(1, 'What Findmart business is for?', '<p>Yes! It is the platform where both Business holders to list their business in order to make it more popular also for the people who want to search their daily needs nearby them. For the business holders there is application named <strong>FINDMART PARTNER</strong> through which they can list their business and make people more aware of their business.</p>\r\n\r\n<p><strong>How to list your business on FINDMART? </strong></p>\r\n\r\n<p>The following steps help to list your business:</p>\r\n\r\n<p>1. At very first step the business holder must register and make login to findmart.</p>\r\n\r\n<p>2. After successfully creating an account user must choose the plan for listing your business and complete the payment .the first listing is free listing</p>\r\n\r\n<p>3. The very first listing is free listing for the period of 28 days after the free plan get over and if you&rsquo;re satisfied and wish to continue as a FINDMART PARTNER you must go through monthly and yearly package.</p>\r\n\r\n<p>4. The note is that only after choosing the plan the user can move for the further step.</p>\r\n\r\n<p>5. Once you choose the plan go to directory and fill the mentioned details with your Business details so that it helps your customer in getting your business easily.</p>\r\n\r\n<p><strong>The following are the most interesting features provided for listing your business:</strong></p>\r\n\r\n<p>1. You are allowed to list your business by adding details of your business</p>\r\n\r\n<p>2. you can add Amenities that are available on your business.</p>\r\n\r\n<p>3. you can add the opening hours of your business that helps your customer before they approach you.</p>\r\n\r\n<p>4. You can add location of your business that helps the customer to find a way towards your business.</p>\r\n\r\n<p>5. Their is feature named customer review though which you can view the feedback of your customer about your business. &emsp;</p>\r\n\r\n<p><strong>FINDMART is only for Business Partners?</strong></p>\r\n\r\n<p>No! FINDMART is for the customers too who are in search for their daily needs. Yes! FINDMART helps all people who are facing problems in finding their nearby marts or shops. You can use FINDMART and make your work easy in searching your daily needs where all variety of businesses listed over FINDMART by doing so you can save both your time and energy.</p>\r\n\r\n<p><strong>How to search business on FINDMART?</strong></p>\r\n\r\n<p>The below mentioned steps helps you to search the business on FINDMART.</p>\r\n\r\n<p>1. At the very first step the user must do the registration on FINDMART</p>\r\n\r\n<p>2. After successfully creating an account user will find all types of verity marts or stores so that they can choose the type of category they want.</p>\r\n\r\n<p>3. When the user selects any particular category the user can read the description of that shop or mart which they want to approach.</p>\r\n\r\n<p>4.The user can view the business listing of that marts, shops, hotels etc</p>\r\n\r\n<p>5. Findmart also provides the feature of checking the Amenities that is available in the selected category.</p>\r\n\r\n<p>6. The user can even check the opening hours of any marts or shops before they approach.</p>\r\n\r\n<p>7. Findmart provided the special feature called Booking System so that the user can book for the things that they are in need of.</p>\r\n\r\n<p>8. The most important feature that we can find is the Location that helps the users to find their needs.</p>\r\n\r\n<p>9. User can also select the category based on their range of amount.</p>\r\n\r\n<p>10. User can even filter the categories city wise.</p>\r\n\r\n<p>11. User can set the radius that helps user to locate the selected category within that distance of radius.</p>\r\n\r\n<p><strong>Top most services of FINDMART: </strong></p>\r\n\r\n<p>1. Room Booking for Hotels.</p>\r\n\r\n<p>2. Table Booking for Restaurants</p>\r\n\r\n<p>3. Taking appointments of Doctors and Personal Care.</p>\r\n\r\n<p><strong>Follow us now: </strong></p>\r\n\r\n<p><a href=\"https://findmart.in\">https://findmart.in</a></p>\r\n\r\n<p><a href=\"https://www.facebook.com/findmartofficial\">Facebook</a></p>\r\n\r\n<p><a href=\"https://www.instagram.com/findmart_india\">Instagram</a></p>\r\n', '635', 1, 1, '6a60de36581d6caf6b7e131f203a801d.jpg', '6a4e24fdf125c40fb4892a57378ee0e2.jpg', '1622053800', '1623522600'),
(2, 'Monsoon season food in india', '<p>Monsoon is that season where your mind immediately switches to a relaxing mood after summer. The rain at the monsoon will make your mind and heart fresh and wants to taste delicious. Here are some monsoon foods that make you enjoy at rainy.</p>\r\n\r\n<p><strong>1. Corn</strong></p>\r\n\r\n<p>Yes, corn is the tasty chat at monsoon search your nearby chat corners and taste the stove-hot bhutta(corn) its tastes even better when you sit with your finds and family members at open space with the cool wind at monsoon. just make sure that your bhutta(corn) must be garnished with plenty of lemon juice and chat masalas.</p>\r\n\r\n<p><strong>2. Samosa</strong></p>\r\n\r\n<p>Samosa is also one of the hot crispy snack that makes us feel joy during the monsoon. People who tasted only potato-stuffed samosa now try with different variety of samosas near you at the best tasty and hygiene snack centre.</p>\r\n\r\n<p>3.<strong> Kachoris</strong></p>\r\n\r\n<p>Kachoris are the best choice of monsoon as a snack make it tastier with potato curry. Don&rsquo;t miss visit the best kachori centre to taste kachoris because the monsoon is especially a spicy season.</p>\r\n\r\n<p>4.<strong>&nbsp;Masala Chai</strong></p>\r\n\r\n<p>When<strong>&nbsp;</strong>we hear the name of masala chai our mind will set to a relaxing mood .yes! Masala chai is completely a stress-buster consisting of ginger and green cardamom which is also good for health and brings more joy at the time of monsoon with raindrops and a cup of tea in hand feels really good.</p>\r\n\r\n<p><strong>5. Soup</strong></p>\r\n\r\n<p>All you need this monsoon is a bowl of hot vegetable soup or plain soup is the best starter for your dinner at monsoon. The monsoon will not only brings joy but also a chance of flue due to a sudden change in season so a bowl of soup helps you to control both flue and warm your taste buds.</p>\r\n', '635', 1, 1, '74ce1b4ae252f07cc51dd92a74b3163b.jpg', '8dccc93f98d0949019cd12a851bc0c0b.jpg', '1623004200', '1623004200'),
(3, 'Choosing directory issue?', '<h2><strong>Choosing plan issue?</strong></h2>\r\n\r\n<p>By assuming that the business owner facing a problem on listing their business we made a short note here to solve your problem.</p>\r\n\r\n<h3><strong>Please follow the steps mentioned below:</strong></h3>\r\n\r\n<p><strong>Menu -&gt;Pricings-&gt;Packages</strong></p>\r\n\r\n<ul>\r\n	<li>The first step is to click the&nbsp;<strong>menu&nbsp;</strong>and after clicking the menu bar the list of functions will appear below.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>The second step is to click on&nbsp;<strong>Pricings</strong>. After clicking pricings the&nbsp;<strong>packages&nbsp;</strong>button will appear. Go to packages and there you will get a list of plans appeared if it is your first listing go to free plan and click&nbsp;<strong>choose a plan</strong> and enjoy the plan for 28 days.</li>\r\n	<li>After the plan gets expires you are requested to purchase a paid plan if you are satisfied with the&nbsp;<strong>FINDMART&nbsp;</strong>team.</li>\r\n</ul>\r\n\r\n<p><strong>Refer to the image shown below:</strong></p>\r\n\r\n<p><img alt=\"guide\" src=\"https://findmart.in/mobile/uploads/guide/step1.jpeg\" style=\"height:600px; width:338px\" /></p>\r\n\r\n<h2><strong>Add new directory issue?</strong></h2>\r\n\r\n<p>The first and most important thing the business owner has to remember is without selecting the plan the user is not allowed for adding a new directory. So choose the plan first by following the steps as mentioned in the note above and then add your new directory.</p>\r\n\r\n<p><strong>Refer to this image for more convenience</strong></p>\r\n\r\n<p><strong><img alt=\"choose plan\" src=\"https://findmart.in/mobile/uploads/guide/step2.jpeg\" style=\"height:600px; width:338px\" /><img alt=\"add directory\" src=\"https://findmart.in/mobile/uploads/guide/step3.jpeg\" style=\"height:600px; margin-left:25px; margin-right:25px; width:338px\" /></strong></p>\r\n\r\n<p>To add a new directory the user should go to the menu and in the menu, there is an option called <strong>Add Listing </strong>click on add listing and fill in the details mentioned on it after filling in all details Click on finish and your business will be successfully get listed.</p>\r\n\r\n<p>This content is mandatory only for the business owners not for the customers.</p>\r\n\r\n<p><strong>If any queries, please contact us at query@findmart.in</strong></p>\r\n\r\n<p><strong>we are happy to help you out.</strong></p>\r\n', '635', 1, 1, '705d78095483fcb2216dfb5e823c80b0.jpg', '16992901b5d9e404bd76f82f57804473.jpg', '1624473000', '1624473000');
